import styled from "styled-components";

export const Track = styled.h2`
  color: white;
`;

export const Channel = styled.h3`
  color: white;
`;

export const Container = styled.div`
  margin: 0 auto;
  text-align: center;
  padding-top: 10px;
  z-index: 0;
`;
